/**
 * Created by abhiram on 6/1/20.
 */
import React from 'react';
import NameFormComponent from './NameFormComponent';
import AddressFormComponent from './AddressFormComponent';
import ZipFormComponent from './ZipFormComponent';
import ContactNumberFormComponent from './ContactNumberFormComponent';
import MemberCountFormComponent from './MemberCountFormComponent';
import DobFormComponent from './DobFormComponent';
import HousingTypeFormComponent from './HousingTypeFormComponent';
import '../../App.css';
import {confirm, showMessage} from '../../Utils/Util';
import {ajaxPost} from '../../Services/Http/Ajax';
import {STATUS_ACTIVE} from '../../Utils/Constants';
import {API_URL} from '../../Utils/Urls';
import {Jumbotron, Container, Form, Button} from 'react-bootstrap';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';

const FamilyContainer = () => {
    let familyData = [];

    const handleSubmitConfirm = (e) => {
        e.preventDefault();
        let title = 'Are you sure you want to proceed?';
        confirm(title, handleSubmit);
    };

    const handleSubmit = () => {
        let familyDetails = {
            nameData: familyData.nameData ? familyData.nameData.nameData : '',
            addressData: familyData.addressData ? familyData.addressData.addressData : '',
            memberCountData: familyData.memberCountData ? familyData.memberCountData.memberCountData : '',
            dobData: familyData.dobData ? familyData.dobData.dobData : '',
            zipData: familyData.zipData ? familyData.zipData.zipData : '',
            contactData: familyData.contactData ? familyData.contactData.contactData : '',
            housingData: familyData.housingData ? familyData.housingData.housingData : ''
        };
        if(familyDetails) {
            let uri = API_URL.CREATE_FAMILY_URL;
            ajaxPost(uri, familyDetails, (response) => {
                if (response.status === STATUS_ACTIVE) {
                }
            });
        } else {
            showMessage('error', 'Something went wrong');
        }
    };

    const buildFamilyData = (childFamilyData) => {
        let dataKey = Object.keys(childFamilyData)[0];
        familyData[dataKey] = childFamilyData;
    };

    return (
        <div>
            <MenuComponent/>
                <Container>
                    <div className="header-label">
                        <h4>Add Family</h4>
                        <h5> Fill out this form to add families to FreshTrak .</h5>
                    </div>
                </Container>
            <form onSubmit={handleSubmitConfirm}>
                <Form.Group controlId="exampleForm.ControlInput1">
                    <div className="container">
                        <NameFormComponent onSelectedChild = {buildFamilyData}/>
                    </div>
                    <div className="container">
                        <AddressFormComponent onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <HousingTypeFormComponent onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <ZipFormComponent onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <ContactNumberFormComponent onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <DobFormComponent onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <MemberCountFormComponent onSelectedChild = {buildFamilyData} />
                    </div>

                        <Container>
                            <Button type="submit" variant="primary">Submit</Button>
                        </Container>

                </Form.Group>
            </form>
            <FooterComponent/>
        </div>
    )
};

export default FamilyContainer;
